    <meta charset="utf-8">
    <title>viewer</title>
    <script src="http://ajax.googleapis.com/ajax/libs/jquery/1/jquery.min.js"></script>
    <script src="https://cdn.rawgit.com/malsup/cycle2/master/build/jquery.cycle2.min.js"></script>
    <script type="text/javascript" src="http://netdna.bootstrapcdn.com/bootstrap/3.3.4/js/bootstrap.min.js"></script>

    <script type="text/javascript" src="https://cdn.rawgit.com/RobertFischer/JQuery-PeriodicalUpdater/master/jquery.periodicalupdater.js"></script>
    <script type="text/javascript">
        var date_time = '0';
        $(function(){
            $.PeriodicalUpdater('get_last_images.php',{
                    method: 'get',
                    minTimeout: 10000,
                    type: 'json',
                    multiplier:1,
                    maxCalls: 0,
                    data: getData
                },
                function(data){ //返り値に変更があったら
                    $('.cycle-slideshow').cycle('reinit');
                    console.log('date_time:', date_time);
                    $.each(data, function(index, value) {
                        console.log('load: ' + index + value);
                        $(".cycle-slideshow").cycle('add', '<img id="' + index + '" src="' + value + '" class="photo img-responsive center-block">');
                        date_time = index;
                    });
                    console.log('date_time:', date_time);
                });
        });

        function getData()
        {
            return 'date_time=' + date_time;
        }
    </script>
